import React from 'react';
import { makeStyles, withStyles } from '@material-ui/core/styles';
import AppBar from '@material-ui/core/AppBar';
import Toolbar from '@material-ui/core/Toolbar';
import Typography from '@material-ui/core/Typography';
import Paper from '@material-ui/core/Paper';

import { green } from '@material-ui/core/colors';
import FormGroup from '@material-ui/core/FormGroup';
import FormControlLabel from '@material-ui/core/FormControlLabel';
import Checkbox from '@material-ui/core/Checkbox';
import Radio from '@material-ui/core/Radio';
import RadioGroup from '@material-ui/core/RadioGroup';



const useHeaderStyles = makeStyles((theme) => ({
  root: {
    flexGrow: 1,
  },
  menuButton: {
    marginRight: theme.spacing(2),
  },
  title: {
    flexGrow: 1,
  },
}));


const useMapStyles = makeStyles((theme) => ({
  root: {
    flexGrow: 1,
    height:"100%",
    backgroundColor:"black"
  },
}));

const useChardStyles = makeStyles((theme) => ({
  root: {
    position:"absolute",
    '& > *': {
      margin: theme.spacing(1),
      width: theme.spacing(52),
      height: theme.spacing(24),
      padding:10,
      left:30
    },
  },
}));

const GreenCheckbox = withStyles({
  root: {
    color: green[400],
    '&$checked': {
      color: green[600],
    },
  },
  checked: {},
})((props) => <Checkbox color="default" {...props} />);



function App() {
  const headerClasses = useHeaderStyles();
  const mapClasses = useMapStyles();
  const cardClasses = useChardStyles();

  const [state, setState] = React.useState({
    checkedA: true,
    checkedB: true,
  });

  const handleChange = (event) => {
    setState({ ...state, [event.target.name]: event.target.checked });
  };

  return (
    <>

    <div className={headerClasses.root}>
      <AppBar position="static">
        <Toolbar>
          <Typography variant="h6" className={headerClasses.title}>
            News
          </Typography>
        </Toolbar>
      </AppBar>
    </div>
    <div className={mapClasses.root}>

        <div className={cardClasses.root}>
          <Paper elevation={3} >

          <FormGroup row>
              <FormControlLabel
                control={<Checkbox checked={state.checkedA} onChange={handleChange} name="checkedA" />}
                label="通常"
              />
              <FormControlLabel
                control={<Checkbox checked={state.checkedB} onChange={handleChange} name="checkedB"  />}
                label="制限"
              />
              <FormControlLabel
                control={<GreenCheckbox checked={state.checkedG} onChange={handleChange} name="checkedG" />}
                label="停止"
              />
              <FormControlLabel
                control={<GreenCheckbox checked={state.checkedG} onChange={handleChange} name="checkedG" />}
                label="設置なし"
              />              
              <FormControlLabel
                control={<GreenCheckbox checked={state.checkedG} onChange={handleChange} name="checkedG" />}
                label="未回答"
              />              
            </FormGroup>

          </Paper>
        </div>

    </div>

    </>

  )
}

export default App;
